import Logo from "./Logo";
import swift from 'programming-languages-logos/src/swift/swift.svg'

const Skills = () => {
    return ( 
        <div className="text-center relative overflow-hidden">
            <h1 className="text-5xl p-10">Skills</h1>
        <div className="w-fit flex gap-x-4  whitespace-nowrap scrollingEffect">
            <Logo imgLink="https://cdn.jsdelivr.net/npm/programming-languages-logos/src/javascript/javascript.png"/>


        </div>
        <div className="fade"></div>
        </div>
     );
}

export default Skills;
